var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro header test object.
 * @param {Object} [props] Initializes a UIAPro Header test object using the supplied property bag.
 * @returns {Header} the description object that was initialized.
 * @class Header
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Header(props) {
    var headerDesc = new UiObjectBaseDescription("Header");

    headerDesc._defineByPropertyBag(props);
    return headerDesc;
}

/**
 * A UIAPro header.
 * @constructor
 * @class HeaderTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function HeaderTO(session, description) {
    description = description || Header();
    var headerTO = new UiObjectBaseTO("UIAProHeader", session, description);
    
    return headerTO;
}

module.exports.HeaderTO = HeaderTO;
module.exports.Header = Header;